import styled from "styled-components"

const Result = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    color: white;
`

function SearchResult({results}){
    return(
        <Result>
            {results.map(product => 
                <div>
                    <p>{product.name}</p>

                    <img src={product.image}/>
                </div>
            )}
        </Result>
    )
}

export default SearchResult
